        if (notFound.size() == 1 && sequence.length == 1) {
            throw failures.failure(info, shouldContain(actual, sequence[0], comparisonStrategy));
        }
        throw failures.failure(info, shouldContain(actual, sequence, notFound, comparisonStrategy));
