void streamGreaterThanLastStreamId(){
    try (ServerSocket ss = new ServerSocket(0);
        ClientFactory clientFactory = newClientFactory()) {
        final int port = ss.getLocalPort();
        final HttpClient client = HttpClient.of(clientFactory, "h2c://127.0.0.1:" + port);
        final CompletableFuture<AggregatedHttpMessage> future1 = client.get("/").aggregate();
        try (Socket s = ss.accept()) {
            final InputStream in = s.getInputStream();
            final BufferedOutputStream bos = new BufferedOutputStream(s.getOutputStream());
            handleInitialExchange(in, bos);
            assertThat(readFrame(in).getByte(3)).isEqualTo(Http2FrameTypes.HEADERS);
            final CompletableFuture<AggregatedHttpMessage> future2 = client.get("/").aggregate();
            assertThat(readFrame(in).getByte(3)).isEqualTo(Http2FrameTypes.HEADERS);
            bos.write(new byte[] { 0x00, 0x00, 0x08, 0x07, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x03, 0x00, 0x00, 0x00, 0x00 });
            bos.flush();
            assertThatThrownBy(future2::join).isInstanceOf(CompletionException.class).hasCauseInstanceOf(UnprocessedRequestException.class);
            assertThat(future1).isNotDone();
            assertThat(readFrame(in).getByte(3)).isEqualTo(Http2FrameTypes.GO_AWAY);
            bos.write(new byte[] { 0x00, 0x00, 0x06, 0x01, 0x25, 0x00, 0x00, 0x00, 0x03, 0x00, 0x00, 0x00, 0x00, 0x0f, (byte) 0x88 });
            bos.flush();
            future1.join();
            assertThat(in.read()).isEqualTo(-1);
        }
    }
}

void testOrdinaryRequest(){
    final ClientRequestContext ctx = newContext();
    final HttpRequest req = mock(HttpRequest.class);
    final HttpResponseWriter actualRes = HttpResponse.streaming();
    @SuppressWarnings("unchecked")
    final Client<HttpRequest, HttpResponse> delegate = mock(Client.class);
    when(delegate.execute(ctx, req)).thenReturn(actualRes);
    final ConcurrencyLimitingHttpClient client = newDecorator(1).apply(delegate);
    assertThat(client.numActiveRequests()).isZero();
    final HttpResponse res = client.execute(ctx, req);
    assertThat(res.isOpen()).isTrue();
    assertThat(client.numActiveRequests()).isEqualTo(1);
    closeAndDrain(actualRes, res);
    assertThat(res.isOpen()).isFalse();
    await().untilAsserted(() -> assertThat(client.numActiveRequests()).isZero());
}

