        @Override
        public void onCompleted() {
            responseObserver.onNext(StreamingInputCallResponse.newBuilder().setAggregatedPayloadSize(totalPayloadSize).build());
            responseObserver.onCompleted();
        }
        @Override
        public void onError(Throwable cause) {
            responseObserver.onError(cause);
        }
    };
}

