int loadLogoFromManifest(Activity activity){
    int logo = 0;
    try {
        final String thisPackage = activity.getClass().getName();
        if (BuildConfig.DEBUG)
            Log.i(TAG, "Parsing AndroidManifest.xml for " + thisPackage);
        final String packageName = activity.getApplicationInfo().packageName;
        final AssetManager am = activity.createPackageContext(packageName, 0).getAssets();
        final XmlResourceParser xml = am.openXmlResourceParser("AndroidManifest.xml");
        int eventType = xml.getEventType();
        while (eventType != XmlPullParser.END_DOCUMENT) {
            if (eventType == XmlPullParser.START_TAG) {
                String name = xml.getName();
                if ("application".equals(name)) {
                    if (BuildConfig.DEBUG)
                        Log.d(TAG, "Got <application>");
                    for (int i = xml.getAttributeCount() - 1; i >= 0; i--) {
                        if (BuildConfig.DEBUG)
                            Log.d(TAG, xml.getAttributeName(i) + ": " + xml.getAttributeValue(i));
                        if ("logo".equals(xml.getAttributeName(i))) {
                            logo = xml.getAttributeResourceValue(i, 0);
                            break;
                        }
                    }
                } else if ("activity".equals(name)) {
                    if (BuildConfig.DEBUG)
                        Log.d(TAG, "Got <activity>");
                    Integer activityLogo = null;
                    String activityPackage = null;
                    boolean isOurActivity = false;
                    for (int i = xml.getAttributeCount() - 1; i >= 0; i--) {
                        if (BuildConfig.DEBUG)
                            Log.d(TAG, xml.getAttributeName(i) + ": " + xml.getAttributeValue(i));
                        String attrName = xml.getAttributeName(i);
                        if ("logo".equals(attrName)) {
                            activityLogo = xml.getAttributeResourceValue(i, 0);
                        } else if ("name".equals(attrName)) {
                            activityPackage = ActionBarSherlockCompat.cleanActivityName(packageName, xml.getAttributeValue(i));
                            if (!thisPackage.equals(activityPackage)) {
                                break;
                            }
                            isOurActivity = true;
                        }
                        if ((activityLogo != null) && (activityPackage != null)) {
                            logo = activityLogo.intValue();
                        }
                    }
                    if (isOurActivity) {
                        break;
                    }
                }
            }
            eventType = xml.nextToken();
        }
    } catch (Exception e) {
        e.printStackTrace();
    }
    if (BuildConfig.DEBUG)
        Log.i(TAG, "Returning " + Integer.toHexString(logo));
    return logo;
}

float xToGraphic(double x,RectangleWrap field){
    double xQuotient = (field.width - leftFrameThickness - rightFrameThickness) / (Math.abs(this.screenParts.get(currentScreen).getxRange()[1] - this.screenParts.get(currentScreen).getxRange()[0]));
    double xDistanceFromLeft = x - this.screenParts.get(currentScreen).getxRange()[0];
    return field.x + leftFrameThickness + (float) (xDistanceFromLeft * xQuotient);
}

