void unaryCall(SimpleRequest req,StreamObserver<SimpleResponse> responseObserver){
    ServerCallStreamObserver<SimpleResponse> obs = (ServerCallStreamObserver<SimpleResponse>) responseObserver;
    SimpleResponse.Builder responseBuilder = SimpleResponse.newBuilder();
    try {
        switch(req.getResponseCompression()) {
            case DEFLATE:
            case GZIP:
                obs.setCompression("gzip");
                break;
            case NONE:
                obs.setCompression("identity");
                break;
            case UNRECOGNIZED:
            default:
                obs.onError(Status.INVALID_ARGUMENT.withDescription("Unknown: " + req.getResponseCompression()).asRuntimeException());
                return;
        }
    } catch (IllegalArgumentException e) {
        obs.onError(Status.UNIMPLEMENTED.withDescription("compression not supported.").withCause(e).asRuntimeException());
        return;
    }
    if (req.getResponseSize() != 0) {
        boolean compressable = compressableResponse(req.getResponseType());
        ByteString dataBuffer = compressable ? compressableBuffer : uncompressableBuffer;
        int offset = random.nextInt(compressable ? compressableBuffer.size() : uncompressableBuffer.size());
        ByteString payload = generatePayload(dataBuffer, offset, req.getResponseSize());
        responseBuilder.getPayloadBuilder().setType(compressable ? PayloadType.COMPRESSABLE : PayloadType.UNCOMPRESSABLE).setBody(payload);
    }
    if (req.hasResponseStatus()) {
        obs.onError(Status.fromCodeValue(req.getResponseStatus().getCode()).withDescription(req.getResponseStatus().getMessage()).asRuntimeException());
        return;
    }
    responseObserver.onNext(responseBuilder.build());
    responseObserver.onCompleted();
}

