        for (int i = 0, length = array.length; i < length; i++) {
            final long deadline = array[i];
            if (deadline != NULL_TIMER) {
                consumer.accept(deadline, timerIdForSlot(j & wheelMask, i));
                if (--numTimersLeft == 0) {
                    return;
                }
            }
        }
    }
