void deliver(){
    if (inDelivery) {
        return;
    }
    inDelivery = true;
    try {
        while (pendingDeliveries > 0 && hasRequiredBytes()) {
            switch(state) {
                case HEADER:
                    readHeader();
                    break;
                case BODY:
                    readBody();
                    pendingDeliveries--;
                    break;
                default:
                    throw new IllegalStateException("Invalid state: " + state);
            }
        }
        final boolean stalled = !hasRequiredBytes();
        if (endOfStream && stalled) {
            assert unprocessed != null;
            final boolean havePartialMessage = !unprocessed.isEmpty();
            if (!havePartialMessage) {
                listener.endOfStream();
                deliveryStalled = false;
                return;
            } else {
                throw Status.INTERNAL.withDescription(DEBUG_STRING + ": Encountered end-of-stream mid-frame").asRuntimeException();
            }
        }
        deliveryStalled = stalled;
    } finally {
        inDelivery = false;
    }
}

