void readHeader(){
    final int type = readUnsignedByte();
    if ((type & RESERVED_MASK) != 0) {
        throw Status.INTERNAL.withDescription(DEBUG_STRING + ": Frame header malformed: reserved bits not zero").asRuntimeException();
    }
    compressedFlag = (type & COMPRESSED_FLAG_MASK) != 0;
    requiredLength = readInt();
    if (requiredLength < 0 || requiredLength > maxMessageSizeBytes) {
        throw Status.RESOURCE_EXHAUSTED.withDescription(String.format("%s: Frame size %d exceeds maximum: %d. ", DEBUG_STRING, requiredLength, maxMessageSizeBytes)).asRuntimeException();
    }
    state = State.BODY;
}

