ByteString generatePayload(ByteString dataBuffer,int offset,int size){
    ByteString payload = ByteString.EMPTY;
    int begin = offset;
    int end = 0;
    int bytesLeft = size;
    while (bytesLeft > 0) {
        end = Math.min(begin + bytesLeft, dataBuffer.size());
        payload = payload.concat(dataBuffer.substring(begin, end));
        bytesLeft -= (end - begin);
        begin = end % dataBuffer.size();
    }
    return payload;
}

