byte[] _mediaPick(BufferedInputStream is){
    try {
        ByteArrayOutputStream baos = new ByteArrayOutputStream(MEDIAPICKLIMIT * 2);
        byte[] buf = new byte[MEDIAPICKLIMIT];
        int readLen;
        int readSoFar = 0;
        is.mark(MEDIAPICKLIMIT * 2);
        while (true) {
            readLen = is.read(buf);
            baos.write(buf);
            if (readLen == -1) {
                break;
            }
            readSoFar += readLen;
            if (readSoFar > MEDIAPICKLIMIT) {
                break;
            }
        }
        is.reset();
        byte[] result = new byte[MEDIAPICKLIMIT];
        System.arraycopy(baos.toByteArray(), 0, result, 0, Math.min(baos.size(), MEDIAPICKLIMIT));
        return result;
    } catch (FileNotFoundException e) {
        return null;
    } catch (IOException e) {
        return null;
    }
}

void cleanupQueue(SubscriptionImpl subscription,Queue<Object> queue){
    final Throwable cause = ClosedPublisherException.get();
    for (; ; ) {
        final Object e = queue.poll();
        if (e == null) {
            break;
        }
        try {
            if (e instanceof CloseEvent) {
                notifySubscriberOfCloseEvent(subscription, (CloseEvent) e);
                continue;
            }
            if (e instanceof CompletableFuture) {
                ((CompletableFuture<?>) e).completeExceptionally(cause);
            }
            @SuppressWarnings("unchecked")
            final T obj = (T) e;
            onRemoval(obj);
        } finally {
            ReferenceCountUtil.safeRelease(e);
        }
    }
}

